import React from 'react';
import './App.css';
import Head from './header';
const App = () => {
  return (
    <div className="App">
        <div>
            <Head />
        </div>
      <p className="text-app">
         ddasdsa
      </p>
        <div>
            <Heading />
        </div>
    </div>
  );
}

const Heading = () => {
    return (
        <div className="App">
            <p>
                123456789
            </p>
        </div>
    );
}
export default App;
